import React from 'react';

export default function Loading({className}) {
  return (
    <img
      className={className}
      alt="loading"
      src="https://res.cloudinary.com/dhd9jgrw3/image/upload/v1587406631/drivers/logo/Cube-1s-200px_lavfua.gif"
    />
  );
}
